// ==UserScript==
// @name         Top-Mods No Timers
// @namespace    https://github.com/Official-Husko/violentmonkey-scripts
// @version      1.0
// @description  Remove the annoying waiting timers
// @author       Official Husko
// @match        https://top-mods.com/*
// @grant        none
// @icon         data:image/png;base64,
// ==/UserScript==

(function() {
    'use strict';

    // Function to modify the first timer element
    function modifyTimer1() {
        var timer1Element = document.getElementById("timer_1");
        if (timer1Element) {
            timer1Element.style.display = "none";
        }
    }

    // Function to modify the second timer element
    function modifyTimer2() {
        var timer2Element = document.getElementById("timer_2");
        if (timer2Element) {
            timer2Element.style.display = "block";
        }
    }

    // Call the functions to modify the elements
    modifyTimer1();
    modifyTimer2();

})();